import { View, Text } from 'react-native'
import React from 'react'
import { HomeIcon } from '../../assets/svg'

export default function index() {
  return (
    <View>

      <Text>index</Text>
      <HomeIcon fill="red" width={500} height={1000} ></HomeIcon>
    </View>
  )
}
